import React from "react";
import ReactDOM from "react-dom";

function card(params) {
   return(
      <>
      <div className="cards">
      <div className="card">
       <img src="https://morningpicker.com/wp-content/uploads/2019/08/dark-netflix-1280x720.jpg" alt="myPic" className="card_img"/>
       <div className="card_info">
       <span className="card_catagory">A netflix Orignol Serios</span>
      <h3 className="card_title">dark</h3>
      <a href="https://www.netflix.com/pk/title/80100172" target="_blank">
         <button> Watch Now </button>
      </a>
       </div>
      </div>

      </div>
      </>
   );
}

ReactDOM.render(<card/>,
   document.getElementById("root")
)
